const PAGE_TITLE = 'Диспетчер - "БКФ Такси"';
const PAGE_FAVICON = '/favicon_dispatcher.ico';

function Dispatcher() {

  useEffect(() => changeMeta(PAGE_TITLE, PAGE_FAVICON), []);

  let {carsList, isLoadingCars} = useDispatcherContext();

  console.log(carsList);

  isLoadingCars = false;

  return (
    <DispatcherProvider>
      <div className={styles.container}>
        <Header />
        <main className={styles.main}>
          <div className={styles.cars}>
            {
              isLoadingCars ? <h3>Идет загрузка</h3> :
                carsList.map((car, index) => {
                return <Car
                  key={index}
                  number={car.car_number}
                  status={car.status}
                />
              })
            }
          </div>
          <OrdersNew />
        </main>
      </div>
    </DispatcherProvider>

  );
}

export default Dispatcher;
